  [],\n\t\"revision_timestamp\": \"2016-05-31T01:09:08.198422\",\n\t\"name\": \"mayaguez-puerto-rico-tsunami-forecast-grids-for-most-model\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Mayaguez, Puerto Rico Forecast Model
  Grids provides bathymetric data strictly for tsunami inundation modeling with the
  Method of Splitting Tsunami (MOST) model. MOST is a suite of numerical simulation
  codes capable of simulating three processes of tsunami evolution: generation, transoceanic
  propagation, and inundation of dry land. Tsunami waves are computationally propagated
  across a set of three nested grids (A, B, and C), each of which is successively
  finer in resolution, moving from offshore to onshore. Nearshore details are resolved
  to the point that model output can be directly compared with tide gauge observations
  and can provide estimates of wave arrival time, wave amplitude and simulation of
  wave inundation onto dry land. A Grid Resolution: 47.2 arc-sec in x direction. 44.8
  arc-sec in y direction. B Grid Resolution: 20.9 arc-sec in the x direction. 20.8
  arc sec in the y direction. C Grid Resolution: 3 arc-sec.\",\n\t\"license_title\":
